import React from 'react';

const PhoneList = props => {
	const shortNumbers = props.shortNumbers.map(shortNumber => {
    	return (
   			<div>
        		<div className="ui center aligned grid">
      			<div className="four wide column">{shortNumber.id}</div>
				<div className="four wide column">{shortNumber.number}<i class="ellipsis vertical icon"></i></div> 
				<div className="four wide column">
					{shortNumber.short_number} 
					{console.log(shortNumber.short_number)}
					{shortNumber.short_number !== "" ? <i class="ellipsis vertical icon"></i> : null}
				</div>
		        <div className="four wide column">
		        	<button className="ui button">Delete</button>
		        		<div className="ui button" tabIndex="0">Modify</div>
		        	</div>
		      	</div>
    		</div>
    	);
	});

	return <div>{shortNumbers}</div>;
};

export default PhoneList;

